import { Routes, Route } from "react-router-dom";
import Main from "./components/main";

function App() {
  return (
    <>
      <h1 id="movie-app">Movie App</h1>
      <Routes>
        <Route path="/" element={<Main />} />
      </Routes>
    </>
  );
}

export default App;
